package at.asitplus.signum.supreme.symmetric

import at.asitplus.signum.HazardousMaterials
import at.asitplus.signum.indispensable.symmetric.SymmetricEncryptionAlgorithm
import at.asitplus.signum.indispensable.symmetric.authTag
import at.asitplus.signum.indispensable.symmetric.keyFrom
import at.asitplus.signum.indispensable.symmetric.nonce
import at.asitplus.signum.supreme.symmetric.discouraged.andPredefinedNonce
import at.asitplus.signum.supreme.symmetric.discouraged.encrypt
import io.kotest.assertions.withClue
import at.asitplus.test.FreeSpec
import io.kotest.datatest.withData
import io.kotest.matchers.shouldBe
import kotlinx.serialization.json.Json
import kotlinx.serialization.json.JsonArray
import kotlinx.serialization.json.jsonObject
import kotlinx.serialization.json.jsonPrimitive

@OptIn(HazardousMaterials::class)
class SymmetricAgainstReference : FreeSpec({
    "AES GCM+CBC and ChaCha20-Poly1305" - {
        val reference: JsonArray = Json.decodeFromString(pregenerated)

        withData(nameFn = {
            it.jsonObject.keys.first()
            val obj = it.jsonObject
            val alg = obj.keys.first()

            val key = obj[alg]!!.jsonObject["key"]!!.jsonPrimitive.content
            "$alg, key: $key"
        }, reference.toList()) {
            val obj = it.jsonObject
            val alg = obj.keys.first()

            val key = obj[alg]!!.jsonObject["key"]!!.jsonPrimitive.content.hexToByteArray()
            val iv = obj[alg]!!.jsonObject["iv"]!!.jsonPrimitive.content.hexToByteArray()
            val plaintext = obj[alg]!!.jsonObject["plain"]!!.jsonPrimitive.content.hexToByteArray()
            val encrypted = obj[alg]!!.jsonObject["encrypted"]!!.jsonPrimitive.content.hexToByteArray()

            val aad = obj[alg]!!.jsonObject["aad"]?.jsonPrimitive?.content?.let {
                if (it == "null") null else it.hexToByteArray()
            }
            val authTag = obj[alg]!!.jsonObject["authTag"]?.jsonPrimitive?.content?.let {
                if (it == "null") null else it.hexToByteArray()
            }


            when (alg) {
                "GCM" -> {
                    when (key.size) {
                        128 / 8 -> SymmetricEncryptionAlgorithm.AES_128.GCM.apply {
                            val key = keyFrom(key).getOrThrow()
                            val box = key.andPredefinedNonce(iv).getOrThrow().encrypt(plaintext, aad).getOrThrow()
                            withClue(encrypted.toHexString()) {
                                box.encryptedData shouldBe encrypted
                                box.authTag shouldBe authTag
                                box.nonce shouldBe iv
                            }
                            box.decrypt(key, aad?:byteArrayOf()).getOrThrow() shouldBe plaintext
                        }

                        192 / 8 -> SymmetricEncryptionAlgorithm.AES_192.GCM.apply {
                            val key = keyFrom(key).getOrThrow()
                            val box = key.andPredefinedNonce(iv).getOrThrow().encrypt(plaintext).getOrThrow()
                            box.encryptedData shouldBe encrypted
                            box.decrypt(key).getOrThrow() shouldBe plaintext
                        }

                        256 / 8 -> SymmetricEncryptionAlgorithm.AES_256.GCM.apply {
                            val key = keyFrom(key).getOrThrow()
                            val box = key.andPredefinedNonce(iv).getOrThrow().encrypt(plaintext).getOrThrow()
                            box.encryptedData shouldBe encrypted
                            box.decrypt(key).getOrThrow() shouldBe plaintext
                        }
                    }
                }

                "CBC" -> {
                    when (key.size) {
                        128 / 8 -> SymmetricEncryptionAlgorithm.AES_128.CBC.PLAIN.apply {
                            val key = keyFrom(key).getOrThrow()
                            val box = key.andPredefinedNonce(iv).getOrThrow().encrypt(plaintext).getOrThrow()
                            box.encryptedData shouldBe encrypted
                            box.decrypt(key).getOrThrow() shouldBe plaintext


                        }

                        192 / 8 -> SymmetricEncryptionAlgorithm.AES_192.CBC.PLAIN.apply {
                            val key = keyFrom(key).getOrThrow()
                            val box = key.andPredefinedNonce(iv).getOrThrow().encrypt(plaintext).getOrThrow()
                            box.encryptedData shouldBe encrypted
                            box.decrypt(key).getOrThrow() shouldBe plaintext
                        }

                        256 / 8 -> SymmetricEncryptionAlgorithm.AES_256.CBC.PLAIN.apply {
                            val key = keyFrom(key).getOrThrow()
                            val box = key.andPredefinedNonce(iv).getOrThrow().encrypt(plaintext).getOrThrow()
                            box.encryptedData shouldBe encrypted
                            box.decrypt(key).getOrThrow() shouldBe plaintext
                        }
                    }
                }

                "CHACHA" -> {
                    SymmetricEncryptionAlgorithm.ChaCha20Poly1305.apply {
                        val key = keyFrom(key).getOrThrow()
                        val box = key.andPredefinedNonce(iv).getOrThrow().encrypt(plaintext, aad).getOrThrow()
                        withClue(encrypted.toHexString()) {
                            box.encryptedData shouldBe encrypted
                            box.authTag shouldBe authTag
                            box.nonce shouldBe iv
                        }
                        box.decrypt(key, aad?:byteArrayOf()).getOrThrow() shouldBe plaintext
                    }
                }

                else -> {}

            }
        }
    }

    "ECB" - {
        val reference: JsonArray = Json.decodeFromString(ecb)

        withData(nameFn = {
            val key = it.jsonObject["key"]!!.jsonPrimitive.content
            "key: $key"
        }, reference.toList()) {
            val obj = it.jsonObject

            val key = obj["key"]!!.jsonPrimitive.content.hexToByteArray()
            val plaintext = obj["plain"]!!.jsonPrimitive.content.hexToByteArray()
            val encrypted = obj["encrypted"]!!.jsonPrimitive.content.hexToByteArray()

            when (key.size) {
                128 / 8 -> SymmetricEncryptionAlgorithm.AES_128.ECB.apply {
                    val key = keyFrom(key).getOrThrow()
                    val box = key.encrypt(plaintext).getOrThrow()
                    withClue(encrypted.toHexString()) {
                        box.encryptedData shouldBe encrypted
                    }
                    box.decrypt(key).getOrThrow() shouldBe plaintext
                }

                192 / 8 -> SymmetricEncryptionAlgorithm.AES_192.ECB.apply {
                    val key = keyFrom(key).getOrThrow()
                    val box = key.encrypt(plaintext).getOrThrow()
                    withClue(encrypted.toHexString()) {
                        box.encryptedData shouldBe encrypted
                    }
                    box.decrypt(key).getOrThrow() shouldBe plaintext
                }

                256 / 8 -> SymmetricEncryptionAlgorithm.AES_256.ECB.apply {
                    val key = keyFrom(key).getOrThrow()
                    val box = key.encrypt(plaintext).getOrThrow()
                    withClue(encrypted.toHexString()) {
                        box.encryptedData shouldBe encrypted
                    }
                    box.decrypt(key).getOrThrow() shouldBe plaintext
                }
            }


        }
    }

    "WRAP" - {
        val reference: JsonArray = Json.decodeFromString(wrap)

        withData(nameFn = {
            val key = it.jsonObject["key"]!!.jsonPrimitive.content
            "key: $key"
        }, reference.toList()) {
            val obj = it.jsonObject

            val key = obj["key"]!!.jsonPrimitive.content.hexToByteArray()
            val plaintext = obj["plain"]!!.jsonPrimitive.content.hexToByteArray()
            val encrypted = obj["encrypted"]!!.jsonPrimitive.content.hexToByteArray()

            when (key.size) {
                128 / 8 -> SymmetricEncryptionAlgorithm.AES_128.WRAP.RFC3394.apply {
                    val key = keyFrom(key).getOrThrow()
                    val box = key.encrypt(plaintext).getOrThrow()
                    withClue(encrypted.toHexString()) {
                        box.encryptedData shouldBe encrypted
                    }
                    box.decrypt(key).getOrThrow() shouldBe plaintext
                }

                192 / 8 -> SymmetricEncryptionAlgorithm.AES_192.WRAP.RFC3394.apply {
                    val key = keyFrom(key).getOrThrow()
                    val box = key.encrypt(plaintext).getOrThrow()
                    withClue(encrypted.toHexString()) {
                        box.encryptedData shouldBe encrypted
                    }
                    box.decrypt(key).getOrThrow() shouldBe plaintext
                }

                256 / 8 -> SymmetricEncryptionAlgorithm.AES_256.WRAP.RFC3394.apply {
                    val key = keyFrom(key).getOrThrow()
                    val box = key.encrypt(plaintext).getOrThrow()
                    withClue(encrypted.toHexString()) {
                        box.encryptedData shouldBe encrypted
                    }
                    box.decrypt(key).getOrThrow() shouldBe plaintext
                }
            }


        }
    }
})


